            display: flex;
            flex-flow: row;
            height: 80vh;
            width: 100%;
            flex-grow: 1;

            flex-shrink: 0;

            height: 100%;
            background-position: 50%;
            background-size: contain;
            background-repeat: no-repeat;

            justify-content: center;
            font-family: monospace;
            font-size: 32rem;
            flex-grow: 1;
            flex-shrink: 0;

<body>
    <div id="root">
        <div id="container">
            <div id="img"><div class="img-bg"></div></div>
            <div id="num"></div>
        </div>
        <button id="run">Go!</button>
    </div>
    <script>
        (function() {
            var imageClasses = [
                "img-bg junior boy",
                "img-bg junior girl",
                "img-bg senior boy",
                "img-bg senior girl",
            ];
            var numbers = [
                "3",
                "4",
                "5",
                "6"
            ];
            var imgEl = document.querySelector("#img .img-bg");
            var numEl = document.querySelector("#num");

            function draw() {
                var ranImgIdx = Math.floor(Math.random() * imageClasses.length);
                var ranNumIdx = Math.floor(Math.random() * numbers.length);

                imgEl.className = imageClasses[ranImgIdx];
                numEl.textContent = numbers[ranNumIdx];
            }

            document.querySelector("button#run").onclick = function() {
                draw();
            };

            document.onkeypress = function(e) {
                if (e.code === "Enter") {
                    draw();
                }
            }
        })();
    </script>
</body>
